    =None, params=None, param_visibilities=None, accepts_messages=False,
    assistant=False, tracking_url=None, worker=None, batchable=None,
    batch_id=None, retry_policy_dict=None, owners=None, **kwargs):
    """
        * add task identified by task_id if it doesn't exist
        * if deps is not None, update dependency list
        * update status of task
        * add additional workers/stakeholders
        * update priority when needed
        """
    assert worker is not None
    worker_id = worker
    worker = self._update_worker(worker_id)
    resources = {} if resources is None else resources.copy()
    if retry_policy_dict is None:
        retry_policy_dict = {}
    retry_policy = self._generate_retry_policy(retry_policy_dict)
    if worker.enabled:
        _default_task = self._make_task(task_id=task_id, status=PENDING,
            deps=deps, resources=resources, priority=priority, family=
            family, module=module, params=params, param_visibilities=
            param_visibilities)
    else:
        _default_task = None
    task = self._state.get_task(task_id, setdefault=_default_task)
    if task is None or task.status != RUNNING and not worker.enabled:
        return
    if status == PENDING and task.status == DONE and time.time(
        ) - task.updated < self._config.stable_done_cooldown_secs:
        return
    if not task.family:
        task.family = family
    if not getattr(task, 'module', None):
        task.module = module
    if not getattr(task, 'param_visibilities', None):
        task.param_visibilities = _get_default(param_visibilities, {})
    if not task.params:
        task.set_params(params)
    if batch_id is not None:
        task.batch_id = batch_id
    if status == RUNNING and not task.worker_running:
        task.worker_running = worker_id
        if batch_id:
            batch_tasks = self._state.get_batch_running_tasks(batch_id)
            task.resources_running = batch_tasks[0].resources_running.copy()
        task.time_running = time.time()
    if accepts_messages is not None:
        task.accepts_messages = accepts_messages
    if tracking_url is not None or task.status != RUNNING:
        task.tracking_url = tracking_url
        if task.batch_id is not None:
