    if batchable is not None:
        task.batchable = batchable
    if task.remove is not None:
        task.remove = None
    if expl is not None:
        task.expl = expl
        if task.batch_id is not None:
            for batch_task in self._state.get_batch_running_tasks(task.batch_id
                ):
                batch_task.expl = expl
    task_is_not_running = task.status not in (RUNNING, BATCH_RUNNING)
    task_started_a_run = status in (DONE, FAILED, RUNNING)
    running_on_this_worker = task.worker_running == worker_id
    if (task_is_not_running or task_started_a_run and
        running_on_this_worker or new_deps):
        if status != task.status or status == PENDING:
            self._update_task_history(task, status)
        self._state.set_status(task, PENDING if status == SUSPENDED else
            status, self._config)
    if status == FAILED and self._config.batch_emails:
        batched_params, _ = self._state.get_batcher(worker_id, family)
        if batched_params:
            unbatched_params = {param: value for param, value in task.
                params.items() if param not in batched_params}
        else:
            unbatched_params = task.params
        try:
            expl_raw = json.loads(expl)
        except ValueError:
            expl_raw = expl
        self._email_batcher.add_failure(task.pretty_id, task.family,
            unbatched_params, expl_raw, owners)
        if task.status == DISABLED:
            self._email_batcher.add_disable(task.pretty_id, task.family,
                unbatched_params, owners)
    if deps is not None:
        task.deps = set(deps)
    if new_deps is not None:
        task.deps.update(new_deps)
    if resources is not None:
        task.resources = resources
    if worker.enabled and not assistant:
        task.stakeholders.add(worker_id)
        for dep in (task.deps or []):
            t = self._state.get_task(dep, setdefault=self._make_task(
                task_id=dep, status=UNKNOWN, deps=None, priority=priority))
            t.stakeholders.add(worker_id)
    self._update_priority(task, priority, worker_id)
    task.retry_policy = retry_policy
    if runnable and status != FAILED and worker.enabled:
        task.workers.add(worker_id)
        self._state.get_worker(worker_id).tasks.add(task)
        task.runnable = runnable

